CREATE PROCEDURE [monitor].[usp_check_cpu_usage] 
AS
BEGIN
  SET NOCOUNT ON ;

  DECLARE 
    @message nvarchar(max)
    ,@threshold int
    ,@cpu_value int;

  SELECT @threshold = [t].[threshold]
  FROM [monitor].[threshold] [t]
  WHERE [t].[counter] = N'cpu_usage';

  SELECT 
    @cpu_value = [record].value('(./Record/SchedulerMonitorEvent/SystemHealth/ProcessUtilization)[1]', 'int')
  FROM 
  (
    SELECT TOP (1) CONVERT(XML, [record]) AS [record]
    FROM sys.dm_os_ring_buffers [rb]
    WHERE [ring_buffer_type] = N'RING_BUFFER_SCHEDULER_MONITOR'
      AND [record] LIKE '% %'
    ORDER BY [timestamp] DESC
  ) AS [cpu_usage];

  IF @cpu_value >= @threshold
  BEGIN
    SET @message = N'Загрузка CPU: ' + CAST(@cpu_value AS nvarchar(3)) + '%';

    EXEC [dbo].[usp_SendMessage]
      @message = @message;
  END;

END;
GO

CREATE   PROCEDURE [monitor].[usp_check_disk_free_space] 
AS
BEGIN
  SET NOCOUNT ON ;

  DECLARE 
    @message nvarchar(max)
    ,@threshold int
    ,@cpu_value int;

  SELECT @threshold = [t].[threshold]
  FROM [monitor].[threshold] [t]
  WHERE [t].[counter] = N'disk_free_space_pct';

  ;WITH [disk_free_space] AS
  (
    SELECT DISTINCT 
      [disk_name] = LEFT([dovs].[volume_mount_point], 1)
      ,[free_space_prc] = CONVERT(decimal(5,2), CONVERT(decimal(18,2), [dovs].[available_bytes]/1048576.0)/CONVERT(decimal(18,2), [dovs].[total_bytes]/1048576.0) * 100)
    FROM sys.master_files [mf]
    CROSS APPLY sys.dm_os_volume_stats([mf].[database_id], [mf].[FILE_ID]) [dovs]
  )
  SELECT @message = STUFF
  ((
    SELECT CHAR(10)
      + N'Свободное место на диске ' + [disk_name] + N': ' + CAST([dfs].[free_space_prc] AS nvarchar(6)) + N'%' + CHAR(10)      
    FROM [disk_free_space] [dfs]
    WHERE [dfs].[free_space_prc] <= @threshold
    FOR XML PATH(N''))
    , 1, 1, N'' 
  );

  IF @message IS NOT NULL
    EXEC [dbo].[usp_SendMessage]
      @message = @message;

END;
GO

CREATE   PROCEDURE [monitor].[usp_check_disk_latency] 
AS
BEGIN
  SET NOCOUNT ON ;

  DECLARE 
    @message nvarchar(max)
    ,@threshold int
    ,@cpu_value int;

  SELECT @threshold = [t].[threshold]
  FROM [monitor].[threshold] [t]
  WHERE [t].[counter] = N'disk_latency';

  IF OBJECT_ID('tempdb..#t_disk_latency') IS NOT NULL
    DROP TABLE [#t_disk_latency];

  SELECT 
    [vfs].[database_id]
    ,[vfs].[file_id]
    ,[vfs].[sample_ms]
    ,[vfs].[num_of_reads]
    ,[vfs].[num_of_writes]
    ,[vfs].[io_stall_read_ms]
    ,[vfs].[io_stall_write_ms]
  INTO [#t_disk_latency]
  FROM sys.dm_io_virtual_file_stats (NULL, NULL) [vfs];

  ;WITH [file_usage_stats] AS 
  (
    SELECT 
      [db_name] = DB_NAME([cur].[database_id])
      ,[file_type] = [mf].[type_desc]
      ,[read_latency] = IIF(([cur].[num_of_reads] - [prev].[num_of_reads]) = 0
                            ,0 
                            ,(([cur].[io_stall_read_ms] - [prev].[io_stall_read_ms]) / ([cur].[num_of_reads] - [prev].[num_of_reads])) 
                            )
      ,[write_latency] = IIF(([cur].[num_of_writes] - [prev].[num_of_writes]) = 0 
                              ,0 
                              ,(([cur].[io_stall_write_ms] - [prev].[io_stall_write_ms]) / ([cur].[num_of_writes] - [prev].[num_of_writes])) 
                            )
    FROM [#t_disk_latency] [cur]
    INNER JOIN [monitor].[disk_latency] [prev] ON [prev].[database_id] = [cur].[database_id]
                                              AND [prev].[file_id] = [cur].[file_id]
    INNER JOIN sys.master_files [mf] ON [mf].[database_id] = [cur].[database_id]
                                    AND [mf].[file_id] = [cur].[file_id]
  )
  SELECT @message = STUFF
  ((
    SELECT CHAR(10)
      + N'Время выполнения операции ' + IIF([unpvt].[io_type] = N'read_latency', N'чтения: ', N'записи: ') + CAST([unpvt].[latency] AS nvarchar(max)) + N' мсек' + CHAR(10)
      + N'База данных: ' + [unpvt].[db_name] + CHAR(10) 
      + N'Тип файла: ' + [unpvt].[file_type] + CHAR(10)      
    FROM
    (
      SELECT 
        [db_name] = [fus].[db_name]
        ,[file_type] = [fus].[file_type]
        ,[read_latency] = [fus].[read_latency]
        ,[write_latency] = [fus].[write_latency]
      FROM [file_usage_stats] [fus]
    ) [p]
    UNPIVOT
    (
      [latency] FOR [io_type] IN ([read_latency], [write_latency])
    ) AS [unpvt]
    WHERE [unpvt].[latency] >= @threshold
    FOR XML PATH(N''))
    , 1, 1, N'' 
  );

  DELETE 
  FROM [monitor].[disk_latency];

  INSERT INTO [monitor].[disk_latency]
  (
    [database_id]
    ,[file_id]
    ,[sample_ms]
    ,[num_of_reads]
    ,[num_of_writes]
    ,[io_stall_read_ms]
    ,[io_stall_write_ms]
  )
  SELECT 
    [tdl].[database_id]
    ,[tdl].[file_id]
    ,[tdl].[sample_ms]
    ,[tdl].[num_of_reads]
    ,[tdl].[num_of_writes]
    ,[tdl].[io_stall_read_ms]
    ,[tdl].[io_stall_write_ms]
  FROM [#t_disk_latency] [tdl];

  IF @message IS NOT NULL
    EXEC [dbo].[usp_SendMessage]
      @message = @message;

END;
GO

CREATE   PROCEDURE [monitor].[usp_check_job_failed] 
AS
BEGIN
  SET NOCOUNT ON ;

  DECLARE 
    @message nvarchar(max)
    ,@threshold bigint;

  SELECT @threshold = [t].[threshold]
  FROM [monitor].[threshold] [t]
  WHERE [t].[counter] = N'lock'

  SELECT @message = STUFF
  ((
    SELECT CHAR(10)
      + N'Задание [' + [j].[name] + N'] завершилось с ошибкой ' + CHAR(10)
      + N'Шаг: ' + [s].[step_name] + CHAR(10) 
      + N'Время запуска: ' + CONVERT(nvarchar(30), [msdb].[dbo].[agent_datetime]([h].[run_date], [h].[run_time]), 120) + CHAR(10) 
      + N'Длительность выполнения: ' + CAST((([h].[run_duration]/10000*3600 + ([h].[run_duration]/100)%100*60 + [h].[run_duration]%100 + 31 ) / 60) AS nvarchar(max)) + N' мин' + CHAR(10)
    FROM [msdb].[dbo].[sysjobhistory] [h]
    INNER JOIN [msdb].[dbo].[sysjobs] [j] ON [j].[job_id] = [h].[job_id]
    INNER JOIN [msdb].[dbo].[sysjobsteps] [s] ON [s].[job_id] = [j].[job_id]
    WHERE [h].[step_id] <> 0
      AND [msdb].[dbo].[agent_datetime]([h].[run_date], [h].[run_time]) >= DATEADD(minute, -15, GETDATE())
      AND [h].[run_status] = 0 -- Failure
    FOR XML PATH(N''))
    , 1, 1, N''
  );

  IF @message IS NOT NULL
    EXEC [dbo].[usp_SendMessage]
      @message = @message;

END;
GO

CREATE PROCEDURE [monitor].[usp_check_lock_wait] 
AS
BEGIN
  SET NOCOUNT ON ;

  DECLARE 
    @message nvarchar(max)
    ,@threshold bigint;

  SELECT @threshold = [t].[threshold]
  FROM [monitor].[threshold] [t]
  WHERE [t].[counter] = N'lock_wait'

  SELECT @message = STUFF
  ((
    SELECT CHAR(10)
      + N'Сессия ' + CAST([p].[spid] as nvarchar(max)) + N' заблокирована сессией ' + CAST([p].[blocked] as nvarchar(max)) + N' дольше ' + CAST([p].[waittime]/1000 as nvarchar(max)) + N' секунд' + CHAR(10)
      + N'Тип ожидания: ' + [p].[lastwaittype] + CHAR(10) 
      + N'База данных: ' + DB_NAME([p].[dbid]) + CHAR(10) 
      + N'Объект ожидания: ' + [p].[waitresource] + CHAR(10)
    FROM sys.sysprocesses [p]
    WHERE [p].[blocked] > 0 
      AND [p].[blocked] <> [p].[spid]
      AND [p].[waittime] >= @threshold * 1000
    FOR XML PATH(N''))
    , 1, 1, N''
  );

  IF @message IS NOT NULL
    EXEC [dbo].[usp_SendMessage]
      @message = @message;

END;
GO


CREATE   PROCEDURE [monitor].[usp_get_job_execution_stats]
(
  @date_from datetime = NULL
  ,@job_name sysname = NULL
)
AS
BEGIN

  SET NOCOUNT ON;

  ;WITH [cte_last_job_run] AS
  (
    SELECT 
      [jh].[job_id]
      ,[jh].[run_status]
      ,[jh].[run_date]
      ,[jh].[run_time]
      ,[jh].[run_duration]
      ,[rn] = RANK() OVER (PARTITION BY [job_id] ORDER BY [run_date] DESC, [run_time] DESC)
    FROM [msdb].[dbo].[sysjobhistory] [jh]
    WHERE [step_id] = 0
  )
  SELECT 
    [job_name] = [j].[name]
    ,[last_run_date] = CONVERT(nvarchar(16), [msdb].[dbo].[agent_datetime]([jh].[run_date], [jh].[run_time]), 120)
    ,[nex_run_date] = CONVERT(nvarchar(16), [msdb].[dbo].[agent_datetime]([js].[next_run_date], [js].[next_run_time]), 120)
    ,[run_status] = CASE [jh].[run_status]
		                  WHEN 0 THEN 'Failed'
		                  WHEN 1 THEN 'Success'
		                  WHEN 2 THEN 'Retry'
		                  WHEN 3 THEN 'Canceled'
		                  WHEN 4 THEN 'In progress'
		                END 
    ,[run_duration] = STUFF(STUFF(STUFF(RIGHT(REPLICATE('0', 8) + CAST([jh].[run_duration] as varchar(8)), 8), 3, 0, ':'), 6, 0, ':'), 9, 0, ':')
  FROM [msdb].[dbo].[sysjobs] [j] 
  INNER JOIN [cte_last_job_run] [jh] ON [j].[job_id] = [jh].[job_id]
  INNER JOIN [msdb].[dbo].[sysjobschedules] [js] ON [js].[job_id] = [j].[job_id]
  WHERE [jh].[rn] = 1
    AND ([msdb].[dbo].[agent_datetime]([jh].[run_date], [jh].[run_time]) >= @date_from OR @date_from IS NULL)
    AND ([j].[name] = @job_name OR @job_name IS NULL);

END;
GO

CREATE   PROCEDURE [monitor].[usp_get_progress]
AS
BEGIN
  SET NOCOUNT ON;

  DECLARE 
    @chat_id bigint
    ,@url nvarchar(max)
    ,@http_headers xml
    ,@json_chat nvarchar(max) = N'{}'
    ,@message_url nvarchar(max)
    ,@success bit
    ,@response nvarchar(max)
    ,@error nvarchar(max)
    ,@message nvarchar(max)
    ,@message_id bigint
    ,@session_id bigint
    ,@command nvarchar(50)
    ,@database sysname
    ,@start_time datetime
    ,@estimated_completion_time datetime
    ,@percent_complete numeric(5,2);

  EXEC [dbo].[usp_get_settings]
    @url = @url OUTPUT 
    ,@http_headers = @http_headers OUTPUT
    ,@chat_id = @chat_id OUTPUT;
   
  IF OBJECT_ID('tempdb..#t_progress') IS NOT NULL
    DROP TABLE [#t_progress];
  
  SELECT 
    [session_id] = [r].[session_id]
    ,[command] = [r].[command]
    ,[database] = DB_NAME([r].[database_id])
    ,[start_time] = [r].[start_time]
    ,[estimated_completion_time] = DATEADD(second, [r].[estimated_completion_time]/1000, GETDATE())
    ,[percent_complete] = [r].[percent_complete]
  INTO [#t_progress]
  FROM sys.dm_exec_requests [r] 
  WHERE [r].[command] IN ('BACKUP DATABASE','RESTORE DATABASE')
  
  DECLARE [cur_progress] CURSOR LOCAL FAST_FORWARD FOR
  SELECT 
    [session_id] = [t].[session_id]
    ,[command] = [t].[command]
    ,[database] = [t].[database]
    ,[start_time] = [t].[start_time]
    ,[estimated_completion_time] = [t].[estimated_completion_time]
    ,[percent_complete] = [t].[percent_complete]
    ,[message_id] = [p].[message_id]
  FROM [#t_progress] [t] 
  LEFT JOIN [monitor].[progress] [p] ON [p].[session_id] = [t].[session_id]

  OPEN [cur_progress];

  WHILE 1 = 1
  BEGIN
    FETCH NEXT FROM [cur_progress] INTO @session_id, @command, @database, @start_time, @estimated_completion_time, @percent_complete, @message_id
    IF @@FETCH_STATUS <> 0 BREAK;

    SET @message = CONCAT(
                          N'Сессия: ' + CONVERT(nvarchar(20), @session_id) + CHAR(10)
                          ,N'База: ' + @database + CHAR(10)
                          ,N'Команда: ' + @command + CHAR(10)
                          ,N'Время начала: ' + CONVERT(nvarchar(50), @start_time, 120) + CHAR(10)
                          ,N'Прогнозируемое время завершения: ' + CONVERT(nvarchar(50), @estimated_completion_time, 120) + CHAR(10)
                          ,REPLICATE(N'▓', FLOOR(@percent_complete/10)) + REPLICATE(N'░', 10 - FLOOR(@percent_complete/10)), CONVERT(nvarchar(6), @percent_complete) + N'%' + CHAR(10)
                         );
    SET @json_chat = N'{}';
    SET @json_chat = JSON_MODIFY(@json_chat, '$.text', @message);
    SET @json_chat = JSON_MODIFY(@json_chat, '$.chat_id', @chat_id);
    
    IF @message_id IS NOT NULL
    BEGIN
            
      SET @message_url = CONCAT(@url, N'editMessageText');
      SET @json_chat = JSON_MODIFY(@json_chat, '$.message_id', @message_id);

      EXEC [dbo].[usp_HttpPost]
        @url = @message_url,
        @headerXml = @http_headers,
        @requestBody = @json_chat,
        @success = @success OUTPUT,
        @response = @response OUTPUT,
        @error = @error OUTPUT;

    END
    ELSE
    BEGIN
            
      SET @message_url = CONCAT(@url, N'sendMessage');  

      EXEC [dbo].[usp_HttpPost]
        @url = @message_url,
        @headerXml = @http_headers,
        @requestBody = @json_chat,
        @success = @success OUTPUT,
        @response = @response OUTPUT,
        @error = @error OUTPUT;

      SELECT TOP (1) @message_id = [message_id]
      FROM OPENJSON (@response, N'$.result')
      WITH 
      (
        [message_id] nvarchar(max) N'$.message_id'
      );

      INSERT INTO [monitor].[progress]
      (
        [session_id]
        ,[message_id]
        ,[command]
        ,[database]
        ,[start_time]
        ,[estimated_completion_time]
      )
      VALUES
      (
        @session_id
        ,@message_id
        ,@command
        ,@database
        ,@start_time
        ,@estimated_completion_time
      );

    END;

  END;

  CLOSE [cur_progress];
  DEALLOCATE [cur_progress];
  
  DECLARE [cur_complete] CURSOR LOCAL FAST_FORWARD FOR
  SELECT 
    [p].[session_id]
    ,[p].[message_id]
    ,[p].[command]
    ,[p].[database]
    ,[p].[start_time]
    ,[p].[estimated_completion_time]
  FROM [monitor].[progress] [p] 
  LEFT JOIN [#t_progress] [t] ON [t].[session_id] = [p].[session_id]
  WHERE [t].[session_id] IS NULL
  
  OPEN [cur_complete];

  WHILE 1 = 1
  BEGIN
    FETCH NEXT FROM [cur_complete] INTO @session_id, @message_id, @command, @database, @start_time, @estimated_completion_time
    IF @@FETCH_STATUS <> 0 BREAK;

    SET @message_url = CONCAT(@url, N'editMessageText');
    SET @message = CONCAT(
                          N'Сессия: ' + CONVERT(nvarchar(20), @session_id) + CHAR(10)
                          ,N'База: ' + @database + CHAR(10)
                          ,N'Команда: ' + @command + CHAR(10)
                          ,N'Время начала: ' + CONVERT(nvarchar(50), @start_time, 120) + CHAR(10)
                          ,N'Прогнозируемое время завершения: ' + CONVERT(nvarchar(50), @estimated_completion_time, 120) + CHAR(10)
                          ,REPLICATE(N'▓', 10), N'100%' + CHAR(10)
                          );
    SET @json_chat = N'{}';
    SET @json_chat = JSON_MODIFY(@json_chat, '$.text', @message);
    SET @json_chat = JSON_MODIFY(@json_chat, '$.chat_id', @chat_id);
    SET @json_chat = JSON_MODIFY(@json_chat, '$.message_id', @message_id);

    EXEC [dbo].[usp_HttpPost]
      @url = @message_url,
      @headerXml = @http_headers,
      @requestBody = @json_chat,
      @success = @success OUTPUT,
      @response = @response OUTPUT,
      @error = @error OUTPUT;

    DELETE
    FROM [monitor].[progress]
    WHERE [session_id] = @session_id;

  END; 
  
  CLOSE [cur_complete];
  DEALLOCATE [cur_complete];

END;
GO

CREATE   PROCEDURE [monitor].[usp_get_top_queries]
(
  @date_from datetime = NULL
  ,@db_name sysname = NULL
  ,@object_name sysname = NULL
)
AS
BEGIN

  SET NOCOUNT ON;

  SET @date_from = ISNULL(@date_from, DATEADD(minute, -30, GETDATE()));

  SELECT TOP (10) 
    --[query_hash] = [query_stats].[query_hash]
	  --,
    [db_name] = MIN([query_stats].[db_name])
    ,[object_name] = MIN([query_stats].[object_name])
    ,[execution_count] = SUM([query_stats].[execution_count])
    ,[min_elapsed_time] = MIN([query_stats].[min_elapsed_time])
    ,[avg_elapsed_time] = SUM([query_stats].[total_elapsed_time])/SUM([query_stats].[execution_count])
    ,[max_elapsed_time] = MAX([query_stats].[max_elapsed_time])
	  ,[statement] = MIN([query_stats].[statement_text])
  FROM (
	  SELECT 
      [qs].[query_hash]
      ,[qs].[execution_count]
      ,[qs].[min_elapsed_time]
      ,[qs].[total_elapsed_time]
      ,[qs].[max_elapsed_time]
		  ,[statement_text] = SUBSTRING([st].[text], ([qs].[statement_start_offset] / 2) + 1, (
				    (
					    CASE [statement_end_offset]
						    WHEN - 1
							    THEN DATALENGTH([st].[text])
						    ELSE [qs].[statement_end_offset]
					    END - [qs].[statement_start_offset]
				    ) / 2
				  ) + 1)
		  ,[db_name] = DB_NAME([st].[dbid])
		  ,[object_name] = OBJECT_NAME([st].[objectid], [st].[dbid])
	  FROM sys.dm_exec_query_stats [qs]
	  CROSS APPLY sys.dm_exec_sql_text([qs].[sql_handle]) [st]
    WHERE [qs].[last_execution_time] >= @date_from
      AND (DB_NAME([st].[dbid]) = @db_name OR @db_name IS NULL)
      AND (OBJECT_NAME([st].[objectid], [st].[dbid]) = @object_name OR @object_name IS NULL)
	  ) AS [query_stats]
  GROUP BY [query_stats].[query_hash]
  ORDER BY [max_elapsed_time] DESC;

END;
GO

CREATE   TRIGGER [dbo].[tr_commands_change]
ON [dbo].[commands]
AFTER INSERT,DELETE,UPDATE
AS 
BEGIN
	SET NOCOUNT ON;

  DECLARE 
    @chat_id bigint
    ,@url nvarchar(max)
    ,@http_headers xml
    ,@json_chat nvarchar(max) = N'{}'
    ,@message_url nvarchar(max)
    ,@success bit
    ,@response nvarchar(max)
    ,@error nvarchar(max)
    ,@commands nvarchar(max);	  

  EXEC [dbo].[usp_get_settings]
    @url = @url OUTPUT 
    ,@http_headers = @http_headers OUTPUT
    ,@chat_id = @chat_id OUTPUT;

  SET @commands = 
  (
    SELECT 
      [command] = [c].[command]
      ,[description] = [c].[description]
    FROM [dbo].[commands] [c]
    FOR JSON AUTO
  );

  SET @message_url = CONCAT(@url, 'setMyCommands');
  SET @json_chat = JSON_MODIFY(@json_chat,'$.commands', @commands);

  EXEC [dbo].[usp_HttpPost]
	  @url = @message_url,
	  @headerXml = @http_headers,
	  @requestBody = @json_chat,
	  @success = @success OUTPUT,
	  @response = @response OUTPUT,
	  @error = @error OUTPUT;

END
GO
ALTER TABLE [dbo].[commands] ENABLE TRIGGER [tr_commands_change]
GO
